function displaySchoolValue(schoolName) {
  client.get(schoolName, (err, reply) => {
    if (err) {
      console.error(`Error retrieving value: ${err}`);
      return;
    }
    console.log(reply); // Logs the value to the console
  });
}

// Test the functions
displaySchoolValue('Holberton');
